var notEmpty = function(){
	
	var lineTool = $('.line-tool');

	lineTool.each(function(){
		var _ = $(this);
		var counter = _.find('.counter');
		var conterVal = parseInt(counter.text());
		if(conterVal != 0){
			counter.css({display: 'block'});
		}else{
			counter.css({display: 'none'});
		}
	})	
};
